"use client"

import { useState } from "react"
import { Button } from "@/components/ui/button"
import { Input } from "@/components/ui/input"
import { Download, ChevronDown } from "lucide-react"
import { toast } from "sonner"
import jsPDF from "jspdf"
import {
  DropdownMenu,
  DropdownMenuTrigger,
  DropdownMenuContent,
  DropdownMenuItem,
} from "@/components/ui/dropdown-menu"
import { checkOrCreateUser } from "../actionts"

const logoBase64 =
  "data:image/png;base64,"
export default function ChatInput({
  onSend,
  messages = [],
}: {
  onSend: (text: string) => void
  messages?: { role: "user" | "assistant"; content: string; created_at?: string }[]
}) {
  const [message, setMessage] = useState("")

  const handleSend = () => {
    if (message.trim() === "") return
    onSend(message)
    setMessage("")
  }

  const downloadFile = (data: Blob, fileName: string) => {
    const url = URL.createObjectURL(data)
    const link = document.createElement("a")
    link.href = url
    link.download = fileName
    link.click()
    URL.revokeObjectURL(url)
  }

  const exportPDF = async () => {
    const doc = new jsPDF()
    const user = await checkOrCreateUser()
    const username = user?.email?.split("@")[0] || "Bilinmeyen Kullanıcı"
    const today = new Date().toLocaleDateString("tr-TR")

    try {
      doc.addImage(logoBase64, "PNG", 10, 10, 20, 20)
      doc.setFontSize(16)
      doc.text("AI-SHARK Sohbet Raporu", 105, 20, { align: "center" })

      doc.setFontSize(10)
      doc.text(`Hazırlayan: ${username}`, 10, 40)
      doc.text(`Tarih: ${today}`, 10, 46)

      let y = 55
      doc.setFontSize(11)
      messages.forEach((msg) => {
        const text = `[${msg.created_at ?? ""}] ${msg.role.toUpperCase()}: ${msg.content}`
        const lines = doc.splitTextToSize(text, 180)
        if (y + lines.length * 7 > 280) {
          doc.addPage()
          y = 10
        }
        doc.text(lines, 10, y)
        y += lines.length * 7 + 4
      })

      doc.setFontSize(9)
      doc.text("Exported by AI-SHARK", 105, 290, { align: "center" })

      const fileName = `chat-${new Date().toISOString().split("T")[0]}.pdf`
      doc.save(fileName)
      toast.success(`PDF başarıyla indirildi: ${fileName}`)
    } catch (e) {
      toast.error("PDF oluşturulurken hata oluştu.")
      console.error("PDF export error:", e)
    }
  }

  const handleExport = (format: "json" | "txt" | "pdf") => {
    if (!messages || messages.length === 0) {
      toast.error("Sohbet boş, indirilecek mesaj yok.")
      return
    }

    const date = new Date().toISOString().split("T")[0]
    const fileName = `chat-${date}.${format}`

    if (format === "json") {
      const blob = new Blob([JSON.stringify(messages, null, 2)], {
        type: "application/json",
      })
      downloadFile(blob, fileName)
      toast.success(`JSON dosyası indirildi → ${fileName}`)
    }

    if (format === "txt") {
      const content = messages
        .map(
          (msg) =>
            `[${msg.created_at ?? ""}] ${msg.role.toUpperCase()}: ${msg.content}`
        )
        .join("\n\n")
      const blob = new Blob([content], { type: "text/plain" })
      downloadFile(blob, fileName)
      toast.success(`TXT dosyası indirildi → ${fileName}`)
    }

    if (format === "pdf") {
      exportPDF()
    }
  }

  return (
    <div className="flex gap-2">
      <Input
        placeholder="Mesajınızı yazın..."
        value={message}
        onChange={(e) => setMessage(e.target.value)}
        onKeyDown={(e) => {
          if (e.key === "Enter") {
            e.preventDefault()
            handleSend()
          }
        }}
      />

      <Button onClick={handleSend}>Gönder</Button>

      <DropdownMenu>
        <DropdownMenuTrigger asChild>
          <Button variant="outline" className="flex items-center gap-1">
            <Download className="w-4 h-4" />
            İndir
            <ChevronDown className="w-4 h-4" />
          </Button>
        </DropdownMenuTrigger>
        <DropdownMenuContent align="end">
          <DropdownMenuItem onClick={() => handleExport("json")}>
            JSON olarak indir
          </DropdownMenuItem>
          <DropdownMenuItem onClick={() => handleExport("txt")}>
            TXT olarak indir
          </DropdownMenuItem>
          <DropdownMenuItem onClick={() => handleExport("pdf")}>
            PDF olarak indir
          </DropdownMenuItem>
        </DropdownMenuContent>
      </DropdownMenu>
    </div>
  )
}